import '../App.css';
import React from "react";
import { useState, useEffect, useMemo } from "react";
import { useNavigate, Link } from "react-router-dom";
import axios from "axios";
import logo from "../components/back.png";


const ShowST = () => {

    const navigate = useNavigate();

    const [images, setImages] = useState([]);

    const getShow = async () => {
        try {
          const response = await axios.get("http://localhost:5000/predict", {
            datestart: selectedDateStart,
            datestop: selectedDateStop,
            periodday: periodday,
            mode: mode,
          });

          navigate("/showdis");

          setMessage(response.data.message);
        } catch (error) {
            console.error("Error:", error);
            setMessage("Failed to show");
        }
    };

    return (
        <div className="Containner-showdis">
            {/* <h2>ผลลัพธ์จาก AI Model</h2>
            <button onClick={fetchPredictions}>โหลดผลลัพธ์ใหม่</button>
            <div style={{ display: "flex", flexWrap: "wrap" }}>
                {images.map((img, index) => (
                    <div key={index} style={{ margin: 10, textAlign: "center" }}>
                        <img src={img.path} alt={img.filename} width="150" />
                        <p><b>{img.filename}</b></p>
                        <p>Prediction: {img.prediction}</p>
                    </div>
                ))}
            </div> */}
            <p className='Text-H'>Prediction</p>
            <button
                className='Button-stylePredict'
            >
            Predict!
            </button>
            <div className='Div-pic'>
                {images.map((img, index) => (
                    <div key={index} className='Div-Pre-Text'>
                        <img src={img.path} alt={img.filename} className='image' />
                        <p><b>{img.filename}</b></p>
                        <p>Prediction: {img.prediction}</p>
                    </div>
                ))}
            </div>
            <div className='Div-back'>
            <Link to="/show" className="logo">
                <img src={logo} alt="" className="Back-ele" />
            </Link>
            <p className='Back-text'>back</p>
            </div>
        </div>
    );
};

export default ShowST;
